#En una población de 500 personas, se realiza un censo para determinar la cantidad de personas de cada género. Se obtienen los datos de edad y género de todas las personas, y se desea conocer la cantidad de personas de género masculino y femenino presentes en la población, además de una lista con las edades de las personas separadas por género.

def contest(list):
    x = 0
    y = 0
    male_list = []
    female_list = []
    for person in list:
        gender = person["faceAttributes"]["gender"]
        age = person["faceAttributes"]["age"]
        if gender == "male":
            x += 1
            male_list.append(age)
        if gender == "female":
            y += 1 
            female_list.append(age)
    print("Hombres",x,"Mujeres",y)
    return [male_list, female_list]
