# Insertion Order

def maxi(list):
    big = 0
    for element in list:
        if element > big:
            big = element
    return big

def insertion_order(list):
    data = []
    while len(list) > 0:   
        big = maxi(list)
        data.append(big)
        list.remove(big)

        
